import Link from '../Components/Link';
import Question from '../Components/Question';
import { SUBMIT_PAGE_PATH, useFecthQuestionsQuery} from '../store';

const qObjects = [
    {
        id:14, 
        question: "How much is 1 + 1 ?",
        alternatives: [
            {id: 1, answer: "2"}, 
            {id: 3, answer: "11"}
        ],
        answerId: 1
    },
]

function QuestionsExam()
{
    const {data, error, isLoading} = useFecthQuestionsQuery();

    const questionsContent = qObjects.map((qObject) => 
    {
        return <div key={qObject.id} style={{paddingTop: 5}}>
            <Question data={qObject}/>
        </div>
    })

    return <div className="centerForm">
        <div className="centerScreen"> 
            <h3>Questions:</h3>
            {questionsContent}
            <div style={{paddingTop: 35}}>
                <Link to={SUBMIT_PAGE_PATH}>
                    <button style={{fontSize : `16px`}}>SUBMIT</button>
                </Link>
            </div>
        </div>
    </div>
}

export default QuestionsExam;
export { qObjects };
